import React from "react";
function TextForm(props) {
  return (
    <div>
      <h1>{props.heading}</h1>
      <div className="mb-3">
        <label for="myBox" className="form-label"></label>
        <textarea className="form-control" id="myBox" rows="3" />
      </div>
    </div>
  );
}
export default TextForm;
